import logo from './logo.svg';
import './App.css';
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';
import { Home } from './components/home';

function App() {
  return (
    <div className="App">
      <h1>Hello World!</h1>
      <Router>
        <div>
          <Switch>
            <Route exact path ="/">
              <Home/>
            </Route>
          </Switch>
        </div>
      </Router>
    </div>
  );
}

export default App;
